import{_ as e,c as i,o as t,ag as l}from"./chunks/framework.BHzxCEDw.js";const d=JSON.parse('{"title":"常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"guide/faq.md","filePath":"guide/faq.md"}'),r={name:"guide/faq.md"};function o(n,a,h,s,p,u){return t(),i("div",null,[...a[0]||(a[0]=[l('<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h1><p>这里是使用 DSLighting 时的常见问题和解决方案。</p><h2 id="安装问题" tabindex="-1">安装问题 <a class="header-anchor" href="#安装问题" aria-label="Permalink to &quot;安装问题&quot;">​</a></h2><h3 id="q-python-版本不兼容怎么办" tabindex="-1">Q: Python 版本不兼容怎么办？ <a class="header-anchor" href="#q-python-版本不兼容怎么办" aria-label="Permalink to &quot;Q: Python 版本不兼容怎么办？&quot;">​</a></h3><p><strong>A:</strong> DSLighting 需要 Python 3.10 或更高版本。请检查你的 Python 版本：</p><p>```bash python --version</p><h1 id="或" tabindex="-1">或 <a class="header-anchor" href="#或" aria-label="Permalink to &quot;或&quot;">​</a></h1><p>python3 --version ```</p><p>如果版本不对，可以使用 <a href="https://github.com/pyenv/pyenv" target="_blank" rel="noreferrer">pyenv</a> 安装正确的版本：</p><p>```bash pyenv install 3.10.0 pyenv local 3.10.0 ```</p><h3 id="q-pip-安装依赖失败" tabindex="-1">Q: pip 安装依赖失败？ <a class="header-anchor" href="#q-pip-安装依赖失败" aria-label="Permalink to &quot;Q: pip 安装依赖失败？&quot;">​</a></h3><p><strong>A:</strong> 尝试以下方案：</p><ol><li><p>升级 pip： ```bash pip install --upgrade pip ```</p></li><li><p>使用 `requirements_local.txt`（不锁定版本）： ```bash pip install -r requirements_local.txt ```</p></li><li><p>使用国内镜像源： ```bash pip install -r requirements.txt -i <a href="https://pypi.tuna.tsinghua.edu.cn/simple" target="_blank" rel="noreferrer">https://pypi.tuna.tsinghua.edu.cn/simple</a> ```</p></li></ol><h2 id="api-配置问题" tabindex="-1">API 配置问题 <a class="header-anchor" href="#api-配置问题" aria-label="Permalink to &quot;API 配置问题&quot;">​</a></h2><h3 id="q-如何配置多个-llm-api" tabindex="-1">Q: 如何配置多个 LLM API？ <a class="header-anchor" href="#q-如何配置多个-llm-api" aria-label="Permalink to &quot;Q: 如何配置多个 LLM API？&quot;">​</a></h3><p><strong>A:</strong> 在 `.env` 文件中使用 `LLM_MODEL_CONFIGS`：</p><p>```bash LLM_MODEL_CONFIGS=&#39;[ {&quot;model&quot;: &quot;gpt-4&quot;, &quot;api_key&quot;: &quot;key1&quot;, &quot;api_base&quot;: &quot;base1&quot;}, {&quot;model&quot;: &quot;claude-3&quot;, &quot;api_key&quot;: &quot;key2&quot;, &quot;api_base&quot;: &quot;base2&quot;} ]&#39; ```</p><h3 id="q-api-调用失败怎么办" tabindex="-1">Q: API 调用失败怎么办？ <a class="header-anchor" href="#q-api-调用失败怎么办" aria-label="Permalink to &quot;Q: API 调用失败怎么办？&quot;">​</a></h3><p><strong>A:</strong> 检查以下几点：</p><ol><li>API 密钥是否正确</li><li>API Base 地址是否正确</li><li>网络连接是否正常</li><li>API 额度是否充足</li></ol><h2 id="数据准备问题" tabindex="-1">数据准备问题 <a class="header-anchor" href="#数据准备问题" aria-label="Permalink to &quot;数据准备问题&quot;">​</a></h2><h3 id="q-mle-bench-数据下载失败" tabindex="-1">Q: MLE-Bench 数据下载失败？ <a class="header-anchor" href="#q-mle-bench-数据下载失败" aria-label="Permalink to &quot;Q: MLE-Bench 数据下载失败？&quot;">​</a></h3><p><strong>A:</strong> MLE-Bench 数据下载可能需要较长时间，请：</p><ol><li>确保网络连接稳定</li><li>尝试使用代理</li><li>分批下载数据集</li></ol><h3 id="q-如何使用自己的数据集" tabindex="-1">Q: 如何使用自己的数据集？ <a class="header-anchor" href="#q-如何使用自己的数据集" aria-label="Permalink to &quot;Q: 如何使用自己的数据集？&quot;">​</a></h3><p><strong>A:</strong> 参考<a href="/dslighting/guide/data-preparation.html">数据准备指南</a>，按照以下步骤：</p><ol><li>创建任务目录</li><li>添加 `config.yaml`</li><li>组织训练和测试数据</li><li>运行任务</li></ol><h2 id="运行问题" tabindex="-1">运行问题 <a class="header-anchor" href="#运行问题" aria-label="Permalink to &quot;运行问题&quot;">​</a></h2><h3 id="q-任务运行失败怎么办" tabindex="-1">Q: 任务运行失败怎么办？ <a class="header-anchor" href="#q-任务运行失败怎么办" aria-label="Permalink to &quot;Q: 任务运行失败怎么办？&quot;">​</a></h3><p><strong>A:</strong> 检查日志文件：</p><p>```bash ls runs/benchmark_results/ ```</p><p>查看错误日志和输出信息，根据错误信息进行调整。</p><h3 id="q-如何提高任务执行速度" tabindex="-1">Q: 如何提高任务执行速度？ <a class="header-anchor" href="#q-如何提高任务执行速度" aria-label="Permalink to &quot;Q: 如何提高任务执行速度？&quot;">​</a></h3><p><strong>A:</strong> 可以尝试：</p><ol><li>使用更快的 LLM 模型</li><li>减少 max_iterations 或 max_steps</li><li>增加 max_workers 参数</li><li>使用 GPU 加速（如果支持）</li></ol><h2 id="web-ui-问题" tabindex="-1">Web UI 问题 <a class="header-anchor" href="#web-ui-问题" aria-label="Permalink to &quot;Web UI 问题&quot;">​</a></h2><h3 id="q-web-ui-无法连接后端" tabindex="-1">Q: Web UI 无法连接后端？ <a class="header-anchor" href="#q-web-ui-无法连接后端" aria-label="Permalink to &quot;Q: Web UI 无法连接后端？&quot;">​</a></h3><p><strong>A:</strong> 确保：</p><ol><li>后端服务正在运行</li><li>CORS 配置正确</li><li>端口号没有被占用</li><li>防火墙没有阻止连接</li></ol><h3 id="q-如何部署-web-ui-到生产环境" tabindex="-1">Q: 如何部署 Web UI 到生产环境？ <a class="header-anchor" href="#q-如何部署-web-ui-到生产环境" aria-label="Permalink to &quot;Q: 如何部署 Web UI 到生产环境？&quot;">​</a></h3><p><strong>A:</strong> 参考 Web UI 的 README 文档，可以部署到：</p><ul><li>Vercel (前端)</li><li>Railway/Render (后端)</li><li>自己的服务器</li></ul><h2 id="其他问题" tabindex="-1">其他问题 <a class="header-anchor" href="#其他问题" aria-label="Permalink to &quot;其他问题&quot;">​</a></h2><h3 id="q-如何贡献代码" tabindex="-1">Q: 如何贡献代码？ <a class="header-anchor" href="#q-如何贡献代码" aria-label="Permalink to &quot;Q: 如何贡献代码？&quot;">​</a></h3><p><strong>A:</strong> 欢迎贡献！请查看：</p><ol><li><a href="https://github.com/usail-hkust/dslighting/blob/main/docs/CONTRIBUTING.md" target="_blank" rel="noreferrer">贡献指南</a></li><li>提交 Issue 讨论你的想法</li><li>创建 Pull Request</li></ol><h3 id="q-如何获取帮助" tabindex="-1">Q: 如何获取帮助？ <a class="header-anchor" href="#q-如何获取帮助" aria-label="Permalink to &quot;Q: 如何获取帮助？&quot;">​</a></h3><p><strong>A:</strong> 可以通过以下方式：</p><ol><li>查看<a href="/dslighting/">文档</a></li><li>提交 <a href="https://github.com/usail-hkust/dslighting/issues" target="_blank" rel="noreferrer">GitHub Issue</a></li><li>加入微信交流群</li></ol><p>还有其他问题？欢迎在 <a href="https://github.com/usail-hkust/dslighting/discussions" target="_blank" rel="noreferrer">GitHub Discussions</a> 中提问！</p>',50)])])}const b=e(r,[["render",o]]);export{d as __pageData,b as default};
